        static IList<IList<int>> PalindromePairs(string[] words)
        {
            IList<IList<int>> ret = new List<IList<int>>();
            Hashtable ht = new Hashtable();
            Hashtable ht2 = new Hashtable();
            for (var i = 0; i < words.Length; i++)
            {
                ht.Add(words[i], i);
            }
            bool hasSpace = ht.ContainsKey("");
            int spaceIndex = -1;
            if (hasSpace)
                spaceIndex = (int)ht[""];

            for (var i = 0; i < words.Length; i++)
            {
                if (hasSpace && words[i] != "" && IsPalindrome(words[i]))
                {
                    var l1 = new List<int> { i, spaceIndex };
                    var l2 = new List<int> { spaceIndex, i };
                    ret.Add(l1);
                    ret.Add(l2);
                    ht2.Add(l1.GetHashCode(), l1);
                    ht2.Add(l2.GetHashCode(), l2);
                }

                string rword = Rword(words[i]);
                if (ht.ContainsKey(rword) && (int)ht[rword] != i)
                {
                    var l1 = new List<int> { i, (int)ht[rword] };
                    var l1hc = string.Format("l{0}r{1}", i, (int)ht[rword]);
                    if (!ht2.ContainsKey(l1hc))
                    {
                        ret.Add(l1);
                        ht2.Add(l1hc, l1);
                    }


                    var l2 = new List<int> { (int)ht[rword], i };
                    var l2hc = string.Format("l{0}r{1}", (int)ht[rword], i);
                    if (!ht2.ContainsKey(l2hc))
                    {
                        ret.Add(l2);
                        ht2.Add(l2hc, l2);
                    }
                }

                for (var k = 1; k < words[i].Length; k++)
                {
                    var left = words[i].Substring(0, k);
                    var right = words[i].Substring(k, words[i].Length - k);
                    if (IsPalindrome(left))
                    {
                        var rright = Rword(right);
                        if (ht.ContainsKey(rright))
                        {
                            var l = new List<int> { (int)ht[rright], i };
                            var lhc = string.Format("l{0}r{1}", (int)ht[rright], i);
                            if (!ht2.ContainsKey(lhc))
                            {
                                ret.Add(l);
                                ht2.Add(lhc, l);
                            }
                        }
                    }
                    if (IsPalindrome(right))
                    {
                        var rleft = Rword(left);
                        if (ht.ContainsKey(rleft))
                        {
                            var l = new List<int> { i, (int)ht[rleft] };
                            var lhc = string.Format("l{0}r{1}", i, (int)ht[rleft]);
                            if (!ht2.ContainsKey(lhc))
                            {
                                ret.Add(l);
                                ht2.Add(lhc, l);
                            }
                        }
                    }
                }
            }

            return ret;
        }

        static string Rword(string word)
        {
            char[] rword2 = word.ToCharArray();
            int len = word.Length - 1;
            for (var j = 0; j < len; j++, len--)
            {
                var t = rword2[j];
                rword2[j] = rword2[len];
                rword2[len] = t;
            }
            return new string(rword2);
        }

        static bool IsPalindrome(string word)
        {
            int size = word.Length;
            for (int i = 0; i < size / 2; i++)
            {
                if (word[i] != word[size - i - 1])
                    return false;
            }
            return true;
        }
    }
}
